import React from 'react';
import { Text } from 'react-native';

const getFullname = (firstName, secondName, thirdName) => {
    return firstName + "" + secondName + "" + thirdName;
}

export function Cat(props) {
    return (
        <Text>
            Hello, I am {props.name}!
        </Text>
    );
}
